import React from 'react'
import { useState } from 'react'
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';

function CreateTicketModal() {

    const [show, setShow] = useState(false)
    const [title, setTitle] = useState("")
    const [descrip, setDescrip] = useState("")
    const [typeOf, setTypeOf] = useState("")
    const [priority, setPriority] = useState("")
    const [status, setStatus] = useState("")
    const handleShow = () => setShow(true)
    const handleClose = () => setShow(false)
    const reload=()=>window.location.reload();

    function handleNewTicket(e) {
        e.preventDefault()

        const formData = new FormData()
        formData.append("title", title)
        formData.append("description", descrip)
        formData.append("type_of", typeOf)
        formData.append("priority", priority)
        formData.append("status", status)

        fetch('/tickets', {
            method: 'POST',
              body: formData
            })
            .then(res => {
                if (res.ok) {
                    res.json()
                    .then(data => {
                        console.log(data)
                        setShow(false)
                    })
                }
            })

    }

    const handleTitleChange = e => {
        setTitle(e.target.value)
    }

   const handleDescripChange = e => {
        setDescrip(e.target.value)
    }

   const handlePriorityChange = e => {
        setPriority(e.target.value)
    }

   const handleStatusChange = e => {
        setStatus(e.target.value)
    }

   const handleTypeOfChange = e => {
        setTypeOf(e.target.value)
    }


  return (
    <div>
         <Button className='btn btn-outline-primary ms-5 h-75' style={{width: 150}} onClick={handleShow}>
                <p>Add Ticket</p>
        </Button>

        <Modal show={show} onHide={handleClose} centered style={{ textAlign: 'center' }} > 

        <Modal.Header closeButton>
            <Modal.Title>Create New Ticket</Modal.Title>
        </Modal.Header>
        <Modal.Body>
            <div>
                <form onSubmit={handleNewTicket}>
                    <label className='form-label'>Title</label>
                    <input onChange={handleTitleChange} type="text" className='modal-edit-control me-5 border border-dark rounded'
                    placeholder='Title'
                    value={title}>
                    </input>

                    <label className='form-label'>Description</label>
                    <input onChange={handleDescripChange} type="text" className='modal-edit-control border border-dark rounded'
                    placeholder='Description'
                    value={descrip}>
                    </input>

                    <label className='form-label'>Priority</label>
                    <select onChange={handlePriorityChange} type="text" className='modal-edit-control border border-dark rounded'
                    placeholder='Priority'
                    value={priority}>
                         <option>Low</option>
                        <option>Medium</option>
                        <option>High</option>
                    </select>

                    <label className='form-label'>Status</label>
                    <select onChange={handleStatusChange} type="text" className='modal-edit-control border border-dark rounded'
                    placeholder='Status'
                    value={status}>
                         <option>Open</option>
                        <option>Resolved</option>
                        <option>In-progress</option>
                    </select>

                    <label className='form-label'>Type of Bug</label>
                    <select onChange={handleTypeOfChange} type="text" className='modal-edit-control border border-dark rounded'
                    placeholder='Type of bug'
                    value={typeOf}>
                        <option>Performance</option>
                        <option>Security</option>
                        <option>Functional</option>
                        <option>Usability</option>
                        <option>Syntax</option>
                        <option>Compatability</option>
                    </select>

                    <button onClick={() => reload()} className='btn btn-outline-primary mt-5 h-75' type='submit'>Confirm Ticket</button>
                </form>
            </div>
        </Modal.Body>
        </Modal>
    </div>
  )
}

export default CreateTicketModal
